const body = $json.body ?? $json;
const sessionId = body.session_id;
if (!sessionId) {
  throw new Error('Missing session_id');
}

const startedAt = body.started_at ? new Date(body.started_at).getTime() : Date.now();
const frontendAgentWebhook = body.frontend_agent_webhook || body.frontend_webhook || 'http://localhost:3000/sim/session/agent-message';
const endCallbackWebhook = body.end_callback_webhook || 'http://localhost:3000/sim/session/end';

const globalData = this.getWorkflowStaticData('global');
if (!globalData.sessions) globalData.sessions = {};

globalData.sessions[sessionId] = {
  sessionId,
  startedAt,
  frontendAgentWebhook,
  endCallbackWebhook,
  candidateId: body.candidate_id || 'unknown',
  scenarioId: body.scenario_id || 'payment_double_charge_vip_discount_v1',
  micActive: false,
  typingLastTs: 0,
  lastSpeechEndTs: 0,
  lowSttCount: 0,
  transcriptCount: 0
};

return [{
  json: {
    session_id: sessionId,
    started_at_ms: startedAt,
    frontend_agent_webhook: frontendAgentWebhook,
    end_callback_webhook: endCallbackWebhook,
    responseBody: {
      ok: true,
      session_id: sessionId,
      message: 'Session started and orchestration scheduled.'
    }
  }
}];

