const body = $json.body ?? $json;
const sessionId = body.session_id;
if (!sessionId) throw new Error('Missing session_id');

const globalData = this.getWorkflowStaticData('global');
if (!globalData.sessions || !globalData.sessions[sessionId]) {
  return [{ json: { shouldReply: false, responseBody: { ok: false, error: 'session_not_found' } } }];
}

const s = globalData.sessions[sessionId];
const eventType = body.event_type;
const data = body.data || {};
const now = Date.now();

let shouldReply = false;
let replyAgent = 'tech_lead';
let replyText = '';

if (eventType === 'mic_state_changed') {
  s.micActive = !!data.mic_active;
}

if (eventType === 'speech_end') {
  s.micActive = false;
  s.lastSpeechEndTs = now;
}

if (eventType === 'typing_state_changed' && data.typing === true) {
  s.typingLastTs = now;
}

if (eventType === 'candidate_message') {
  s.transcriptCount = (s.transcriptCount || 0) + 1;
  const txt = String(data.text || '').toLowerCase();
  const conf = Number(data.stt_confidence ?? 1);
  const addressed = String(data.addressed_to || '').toLowerCase();

  if (conf < 0.75) {
    s.lowSttCount = (s.lowSttCount || 0) + 1;
    shouldReply = true;
    replyAgent = addressed || 'tech_lead';
    replyText = s.lowSttCount >= 2
      ? 'I still could not catch that clearly. Please type one short line so we do not lose time.'
      : 'I did not catch the last part clearly. Please repeat in one short line.';
  } else {
    s.lowSttCount = 0;

    if (['qa', 'ba', 'tech_lead', 'techlead'].includes(addressed)) {
      replyAgent = addressed === 'techlead' ? 'tech_lead' : addressed;
      shouldReply = true;
      replyText = replyAgent === 'qa'
        ? 'QA here. Confirm the exact repro step you want first, then I will provide logs.'
        : replyAgent === 'ba'
          ? 'BA here. Give me your delivery decision and ETA in one line.'
          : 'Tech Lead here. Be explicit: priority, risk, and rollback.';
    } else {
      const isQAIntent = /(repro|test|log|steps|duplicate)/.test(txt);
      const isBAIntent = /(scope|deadline|eta|business|impact|campaign|vip)/.test(txt);
      const isTLIntent = /(trade|risk|rollback|design|approach|hotfix|feature)/.test(txt);

      if (isQAIntent || isBAIntent || isTLIntent) {
        shouldReply = true;
        replyAgent = isQAIntent ? 'qa' : (isBAIntent ? 'ba' : 'tech_lead');
        replyText = replyAgent === 'qa'
          ? 'QA update: I can share repro and validation criteria. What do you want first?'
          : replyAgent === 'ba'
            ? 'BA update: I need your sequencing decision and business impact statement.'
            : 'Tech Lead: choose now and justify with production risk.';
      }
    }
  }
}

globalData.sessions[sessionId] = s;

return [{
  json: {
    shouldReply,
    endpointUrl: s.frontendAgentWebhook,
    body: {
      session_id: sessionId,
      message_id: `msg_route_${Date.now()}`,
      agent: replyAgent,
      kind: 'question',
      text: replyText,
      ts_sec: null,
      meta: { anchor: false, routed: true }
    },
    responseBody: { ok: true, should_reply: shouldReply }
  }
}];
